import React from 'react';

function Gif({title, id, url}){
  return (
    <div style={style} className="row-lg-4 row-md-6 row-sm-12">
      <div className="card">
          <a href={url} target="_blank" rel="noopener noreferrer" className="text-center">
              <img src={url} alt={title} className="card-img-top img-fluid" />
          </a>
          <div className="card-body">
              <p className="card-text">{title}</p>

              <a href={url} target="_blank" rel="noopener noreferrer" className="btn btn-success">Ver</a>
          </div>
      </div>
    </div>
  )
}

const style = {
  display: 'inline-block'
}
const img = {
  maxWidth: '150px'
}
export default Gif;
